[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "reactome"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?pathway ?pathwayName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?proteinRef bp:xref ?xref .
  ?xref a bp:UnificationXref ;
    bp:db "Ensembl"^^xsd:string ;
    bp:id "ENSG00000012048" .

  ?entity bp:entityReference ?proteinRef .

  ?reaction bp:left|bp:right ?entity .

  ?pathway a bp:Pathway ;
    bp:displayName ?pathwayName ;
    bp:pathwayComponent+ ?reaction .
}
ORDER BY ?pathwayName"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?proteinRef ?name ?xrefDb ?xrefId
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?proteinRef a bp:ProteinReference ;
    bp:name ?name ;
    bp:xref ?xref .
  ?xref bp:db ?xrefDb ;
    bp:id ?xrefId .
  FILTER(CONTAINS(?xrefId, "ENSG00000012048"))
}
LIMIT 50"}}, {"name": "mcp__togomcp__search_reactome_entity", "input": {"query": "BRCA1", "rows": 20}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX reactome: <http://www.reactome.org/biopax/68/49646#>

SELECT DISTINCT ?pathway ?pathwayName ?organism
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  # Find BRCA1 protein
  reactome:Protein50949 bp:displayName ?proteinName .

  # Find entities that reference this protein
  ?entity bp:entityReference/bp:name "BRCA1" .

  # Find reactions involving these entities
  ?reaction bp:left|bp:right|bp:controller ?entity .

  # Find pathways containing these reactions
  ?pathway a bp:Pathway ;
    bp:displayName ?pathwayName ;
    bp:pathwayComponent+ ?reaction .

  OPTIONAL {
    ?pathway bp:organism ?org .
    ?org bp:name ?organism .
  }

  FILTER(?organism = "Homo sapiens" || !BOUND(?organism))
}
ORDER BY ?pathwayName
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?pathway ?pathwayName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?pathway a bp:Pathway ;
    bp:displayName ?pathwayName .
  ?pathwayName bif:contains "'BRCA1'" option (score ?sc)
}
ORDER BY DESC(?sc)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?pathway ?pathwayName ?reactomeId
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  # Find protein references with name BRCA1
  ?proteinRef a bp:ProteinReference ;
    bp:name "BRCA1" .

  # Find physical entities that reference BRCA1
  ?entity bp:entityReference ?proteinRef .

  # Find reactions or controls involving these entities
  {
    ?item bp:left|bp:right ?entity .
  } UNION {
    ?item bp:controller ?entity .
  }

  # Find pathways that contain these reactions
  ?pathway a bp:Pathway ;
    bp:displayName ?pathwayName ;
    bp:pathwayComponent+ ?item .

  # Get Reactome ID from xref
  OPTIONAL {
    ?pathway bp:xref ?xref .
    ?xref a bp:UnificationXref ;
      bp:db "Reactome"^^xsd:string ;
      bp:id ?reactomeId .
  }

  # Filter for human pathways
  OPTIONAL {
    ?pathway bp:organism ?org .
    ?org bp:name ?organism .
  }
  FILTER(!BOUND(?organism) || ?organism = "Homo sapiens")
}
ORDER BY ?pathwayName
LIMIT 100"}}, {"name": "mcp__togomcp__togoid_convertId", "input": {"ids": "ENSG00000012048", "route": "ensembl_gene,uniprot", "limit": 10}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?pathway ?pathwayName ?reactomeId
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  # Find protein reference with UniProt ID P38398 (BRCA1)
  ?proteinRef a bp:ProteinReference ;
    bp:xref ?uniprotXref .
  ?uniprotXref a bp:UnificationXref ;
    bp:db "UniProt"^^xsd:string ;
    bp:id "P38398" .

  # Find entities that reference this protein
  ?entity bp:entityReference ?proteinRef .

  # Find reactions involving these entities
  {
    ?reaction bp:left|bp:right ?entity .
  } UNION {
    ?catalysis a bp:Catalysis ;
      bp:controller ?entity ;
      bp:controlled ?reaction .
  }

  # Find pathways containing these reactions
  ?pathway a bp:Pathway ;
    bp:displayName ?pathwayName ;
    bp:pathwayComponent+ ?reaction .

  # Get Reactome stable ID
  OPTIONAL {
    ?pathway bp:xref ?reactomeXref .
    ?reactomeXref a bp:UnificationXref ;
      bp:db "Reactome Database ID Release 68"^^xsd:string ;
      bp:id ?reactomeId .
  }

  # Filter for human pathways
  OPTIONAL {
    ?pathway bp:organism ?org .
    ?org bp:name ?organism .
  }
  FILTER(!BOUND(?organism) || ?organism = "Homo sapiens")
}
ORDER BY ?pathwayName"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?proteinRef ?name ?db ?id
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?proteinRef a bp:ProteinReference ;
    bp:name ?name ;
    bp:xref ?xref .
  ?xref bp:db ?db ;
    bp:id ?id .

  FILTER(CONTAINS(?name, "BRCA1"))
  FILTER(?name = "BRCA1")
}
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?protein ?displayName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?protein a bp:Protein ;
    bp:displayName ?displayName .
  ?displayName bif:contains "'BRCA1'" option (score ?sc)
}
ORDER BY DESC(?sc)
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?pathway ?pathwayName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  # Find BRCA1 proteins (human)
  ?protein a bp:Protein ;
    bp:displayName "BRCA1" .

  # Find reactions involving BRCA1
  {
    ?reaction bp:left|bp:right ?protein .
  } UNION {
    ?reaction bp:left|bp:right ?complex .
    ?complex bp:component+ ?protein .
  } UNION {
    ?catalysis a bp:Catalysis ;
      bp:controller ?protein ;
      bp:controlled ?reaction .
  }

  # Find pathways containing these reactions
  ?pathway a bp:Pathway ;
    bp:displayName ?pathwayName ;
    bp:pathwayComponent+ ?reaction .
}
ORDER BY ?pathwayName
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX reactome: <http://www.reactome.org/biopax/40/48887#>

SELECT ?pathway ?pathwayName ?comment ?xrefDb ?xrefId
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  VALUES ?pathway {
    reactome:Pathway756
    reactome:Pathway758
    reactome:Pathway765
  }

  ?pathway a bp:Pathway ;
    bp:displayName ?pathwayName .

  OPTIONAL { ?pathway bp:comment ?comment . }

  OPTIONAL {
    ?pathway bp:xref ?xref .
    ?xref bp:db ?xrefDb ;
      bp:id ?xrefId .
  }
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?pathwayName ?reactomeId
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?pathway a bp:Pathway ;
    bp:displayName ?pathwayName .

  # Get Reactome stable ID
  OPTIONAL {
    ?pathway bp:xref ?reactomeXref .
    ?reactomeXref bp:db "Reactome"^^xsd:string ;
      bp:id ?reactomeId .
  }

  # Search for pathways that mention BRCA1 in the name or contain BRCA1 reactions
  {
    ?pathwayName bif:contains "'BRCA1'" option (score ?sc)
  }
  UNION
  {
    # Find pathways containing proteins with BRCA1 in their name
    ?pathway bp:pathwayComponent+ ?component .
    ?component bp:left|bp:right|bp:controller ?entity .
    ?entity bp:displayName ?entityName .
    FILTER(CONTAINS(LCASE(STR(?entityName)), "brca1"))
  }
}
ORDER BY ?pathwayName
LIMIT 50"}}]

