[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?medium ?label ?group ?ph
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?medium a schema:CultureMedium ;
          rdfs:label ?label ;
          schema:belongsToGroup ?group .
  OPTIONAL { ?medium schema:hasFinalPH ?ph }
  ?label bif:contains "'thermococcus' AND 'marine'"
}
ORDER BY ?label
LIMIT 30"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?medium ?mediumLabel ?ingredient ?ingredientLabel ?gPerL ?isOptional
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?composition a schema:MediumComposition ;
               schema:partOfMedium ?medium ;
               schema:containsIngredient ?ingredient ;
               schema:gramsPerLiter ?gPerL .
  ?medium rdfs:label ?mediumLabel .
  ?ingredient rdfs:label ?ingredientLabel .
  OPTIONAL { ?composition schema:isOptionalIngredient ?isOptional }
  FILTER(?medium = <https://purl.dsmz.de/mediadive/medium/760>)
}
ORDER BY DESC(?gPerL)"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?medium ?label ?ph ?minPH ?maxPH ?isComplex ?docLink
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  VALUES ?medium { <https://purl.dsmz.de/mediadive/medium/760> }
  ?medium a schema:CultureMedium ;
          rdfs:label ?label ;
          schema:isComplex ?isComplex .
  OPTIONAL { ?medium schema:hasFinalPH ?ph }
  OPTIONAL { ?medium schema:hasMinPH ?minPH }
  OPTIONAL { ?medium schema:hasMaxPH ?maxPH }
  OPTIONAL { ?medium schema:hasLinkToSource ?docLink }
}"}}]

[{"name": "mcp__togomcp__list_databases", "input": {}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "medgen"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "medgen", "sparql_query": "PREFIX mo: <http://med2rdf/ontology/medgen#>
